import logo from './logo.svg';
import './App.css';

class App extends Component {
  componentDidMount() {
    const api = 'https://am7aydgcsg.execute-api.us-east-2.amazonaws.com/dev';
    const data = { "name" : "Mike" };
    axios
      .post(api, data)
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
    }
  render() {
    return (
      <div>Medium Tutorial</div>
    );
  }
}

